sc_cat_item_producer.script:
/** This script is executed before the Record is generated
* `current`- GlideRecord produced by Record Producer
* Don't use `current.update()` or `current.insert()` as the record is generated by Record Producer
* Don't use `current.setValue('sys_class_name', 'xxx')` as this will trigger reparent flow and can cause data loss
* Avoid `current.setAbortAction()` and generate a separate record
* Use `producer.var1` to access variables
*/
// https://www.servicenow.com/community/it-service-management-forum/how-do-i-update-a-record-from-a-service-catalog-item-using-a/m-p/803586
// So the record Producer Script would be something like this where you have the user 
// entering in an incident number to update the description on an incident 
// (variables:   u_incident, comments):

var books = new GlideRecord("x_898711_library_m_book_transaction");
if (books.get(producer.number)){//if you found an incident
	gs.info("Number "+producer.number+" found!");
// // 	books.short_description += producer.number;
// // 	books.update();
}
producer.redirect='x_898711_library_m_book_transaction_list.do?sys_id=' + current.sys_id;
// nav_to.do?uri=%2Fx_898711_library_m_book_transaction_list.do%3Fsysparm_userpref_module%3D8a3c184097a211103e1f7cb0f053afa7%26sysparm_query%3Du_field_name_1DYNAMIC90d1921e5f510100a9ad2572f2b477fe%255Estate%253D-5%255EORstate%253D2%255EEQ%26sysparm_clear_stack%3Dtrue
current.setAbortAction(true);   //this aborts the Record Producer from creating a new incident if you set the Record Producer table to incident.
